import React from "react";
import "./weather.css";

export default function Weather() {
  return (
    <div className="Weather">
      <h1>Stockholm</h1>
      <ul>
        <li> Monday 8:30</li>
        <li> Sunny</li>
      </ul>
    </div>
  );
}
